import React, { Component } from 'react'
import './Navbar.css'

export class Navbar extends Component {
  render() {
    return (
      <header>
        <h2><a>Store to Table</a></h2>
        <nav>
            <li><a onClick={this.props.onNewRecipe}>New Recipe</a></li>
            <li><a>Recipes</a></li>
            <li><a>Shopping List</a></li>
            <li><a>About</a></li>
        </nav>
      </header>
    )
  }
}

export default Navbar
